	return (
		<Container className="foot">
      <Row className="line"></Row>
      <Row>
      <div className="d-flex justify-content-start">
				
        CODE AND DESIGN BY NIDHI PARAB
      
    </div>
      </Row>
			
		</Container>
	);
}

export default Footer;
